import React from 'react';
import { Form } from 'react-bootstrap';

export default function SignIn (){
  return(
    <>
      <Form>
        <Form.Label>Full name</Form.Label>
        <Form.Control type='text'></Form.Control>
      </Form>
    </>
  )
}
